import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  class Toggle extends React.Component {
    constructor(props){
      super(props);
      this.state = {  Toglu : true};
      this.handlemarbo = this.handlemarbo.bind(this);
    }

    handlemarbo(){
      this.setState( state => ({
        Toglu : !state.Toglu
      }))
    }
  }
  // setInterval(tick, 1000);
}

export default App;
